import { createSlice } from "@reduxjs/toolkit";

const initialState = [
    {id:'123', title:"World", content:"Hello World"},
    {id:'123', title:"Space", content:"Hello Space"}
]

const postSlice = createSlice({
    name:"post",
    initialState,
    reducers:{}
})

export default postSlice.reducer
